script: |
  super -f text -I q5388.spq | sort > q5388.out

inputs:
  - name: q5388.spq
    data: |
      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) WHERE NOT - col2 + - col2 NOT BETWEEN - 10 * - col2 AND col1 + CAST ( - col2 + 86 AS INTEGER ) * + ( col2 * col0 - + col0 );
  - name: tab1

outputs:
  - name: q5388.out
    data: |
